-- ----------------------------
-- Procedure structure for GET_OWN_SCHEDULE_LIST
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_OWN_SCHEDULE_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_OWN_SCHEDULE_LIST`(IN `param_medic_id` int)
BEGIN
	SELECT p.id AS 'id', 
		CONCAT(pacienti.nume, ' ', pacienti.prenume) AS 'pacient', 
		competente.denumire AS 'specializare', 
		denumire_servicii.denumire AS 'denumire_serviciu', 
		policlinici.denumire AS 'policlinica', 
		p.data_programare AS 'data_programare'
	FROM programari p
	INNER JOIN pacienti ON p.pacient_id = pacienti.id
	INNER JOIN competente ON p.competenta_id = competente.id
	INNER JOIN denumire_servicii ON p.serviciu_id = denumire_servicii.id
	INNER JOIN policlinici ON p.policlinica_id = policlinici.id
	WHERE status = '1'
	AND p.medic_id = param_medic_id
	ORDER BY p.data_programare ASC;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GET_OWN_SCHEDULE_LIST_DATE_AND_DURATION
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_OWN_SCHEDULE_LIST_DATE_AND_DURATION`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_OWN_SCHEDULE_LIST_DATE_AND_DURATION`(IN `param_medic_id` int, IN `param_data_inceput` DATETIME, IN `param_data_sfarsit` DATETIME)
BEGIN
	SELECT programari.data_programare AS 'data_programare', servicii.durata AS 'durata'
	FROM programari
	INNER JOIN servicii ON (
					servicii.denumire_id = programari.serviciu_id 
			AND servicii.medic_id = programari.medic_id
			AND servicii.competenta_id = programari.competenta_id
	)
	WHERE programari.medic_id = param_medic_id
	AND programari.status = '1'
	AND (programari.data_programare BETWEEN param_data_inceput AND param_data_sfarsit);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GET_RECEIPT_INFO
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_RECEIPT_INFO`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_RECEIPT_INFO`(IN `param_id_bon` int)
BEGIN
	SELECT
		policlinici.denumire AS 'policlinica_denumire',
		policlinici.adresa AS 'policlinica_adresa',
		policlinici.telefon AS 'policlinica_telefon',
		policlinici.email AS 'policlinica_email',
		CONCAT(pacienti.nume, ' ', pacienti.prenume) AS 'pacient',
		CONCAT(angajati.nume, ' ', angajati.prenume) AS 'medic',
		competente.denumire AS 'specializare',
		denumire_servicii.denumire AS 'serviciu',
		programari.data_programare AS 'data_interventie',
		bonuri_emise.suma AS 'total',
		bonuri_emise.data_tiparire AS 'data_curenta',
		bonuri_emise.id AS 'id_unic'
	FROM bonuri_emise
	INNER JOIN programari ON programari.id = bonuri_emise.programare_id
	INNER JOIN policlinici ON programari.policlinica_id = policlinici.id
	INNER JOIN pacienti ON programari.pacient_id = pacienti.id
	INNER JOIN angajati ON programari.medic_id = angajati.id
	INNER JOIN competente ON programari.competenta_id = competente.id
	INNER JOIN denumire_servicii ON programari.serviciu_id = denumire_servicii.id
	WHERE bonuri_emise.id = param_id_bon;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GET_REPORT_INFO
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_REPORT_INFO`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_REPORT_INFO`(IN `param_report_id` int)
BEGIN
	SELECT
		CONCAT(angajati.nume, ' ', angajati.prenume) AS 'medic',
		angajati.telefon AS 'medic_telefon',
		angajati.email AS 'medic_email',
		CONCAT(pacienti.nume, ' ', pacienti.prenume) AS 'pacient',
		pacienti.cnp AS 'pacient_cnp',
		pacienti.telefon AS 'pacient_telefon',
		pacienti.email AS 'pacient_email',
		rapoarte.data_raport AS 'data_raport',
		rapoarte.istoric AS 'istoric',
		rapoarte.simptome AS 'simptome',
		rapoarte.investigatii AS 'investigatii',
		rapoarte.diagnostic AS 'diagnostic',
		rapoarte.recomandari AS 'recomandari',
		rapoarte.parafa AS 'parafa',
		rapoarte.id AS 'id_unic'
	FROM rapoarte
	INNER JOIN pacienti ON rapoarte.pacient_id = pacienti.id
	INNER JOIN angajati ON rapoarte.medic_id = angajati.id
	WHERE rapoarte.id = param_report_id;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GET_SCHEDULE_LIST
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_SCHEDULE_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_SCHEDULE_LIST`(IN `param_policlinica_id` INT)
BEGIN
	SELECT p.id AS 'id',
		CONCAT(pacienti.nume, ' ', pacienti.prenume) AS 'pacient', 
		competente.denumire AS 'specializare', 
		denumire_servicii.denumire AS 'denumire_serviciu', 
		policlinici.denumire AS 'policlinica'
	FROM programari p
	INNER JOIN pacienti ON p.pacient_id = pacienti.id
	INNER JOIN competente ON p.competenta_id = competente.id
	INNER JOIN denumire_servicii ON p.serviciu_id = denumire_servicii.id
	INNER JOIN policlinici ON p.policlinica_id = policlinici.id
	WHERE (p.status = '0' OR p.status = '1')
	AND p.policlinica_id = param_policlinica_id;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GET_WAITING_SCHEDULE_LIST
-- ----------------------------
DROP PROCEDURE IF EXISTS `GET_WAITING_SCHEDULE_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_WAITING_SCHEDULE_LIST`(IN `param_medic_id` int, IN `param_policlinica_id` int)
BEGIN
	SELECT p.id AS 'id',
		CONCAT(pacienti.nume, ' ', pacienti.prenume) AS 'pacient', 
		competente.denumire AS 'specializare', 
		denumire_servicii.denumire AS 'denumire_serviciu', 
		policlinici.denumire AS 'policlinica'
	FROM programari p
	INNER JOIN pacienti ON p.pacient_id = pacienti.id
	INNER JOIN competente ON p.competenta_id = competente.id
	INNER JOIN denumire_servicii ON p.serviciu_id = denumire_servicii.id
	INNER JOIN policlinici ON p.policlinica_id = policlinici.id
	WHERE p.serviciu_id IN (SELECT denumire_id FROM servicii WHERE medic_id = param_medic_id)
	AND p.policlinica_id IN (SELECT policlinica_id FROM program_angajati WHERE angajat_id = param_medic_id)
	AND p.competenta_id IN (SELECT competenta_id FROM specialitati WHERE medic_id = param_medic_id)
	AND p.policlinica_id = param_policlinica_id
	AND p.status = '0'
	ORDER BY p.data_programare ASC;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for SET_ADMIN_LEVEL
-- ----------------------------
DROP PROCEDURE IF EXISTS `SET_ADMIN_LEVEL`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SET_ADMIN_LEVEL`(username varchar(45), admin_type int(11))
BEGIN
	UPDATE `angajati`
    SET `admin_type` = admin_type
    WHERE `username` = username;
END
;;
DELIMITER ;
